import './lovedmovies.css';
import React from 'react'

const LovedMovies = ({movie}) => {
  return (
    <div className='lovedMovies'>
      <img src={movie.Poster} alt="" />
      <h3>{movie.Title}</h3>
      <div className='loved'></div>
    </div>
  )
}

export default LovedMovies;
